module.exports = {
  parser: '@typescript-eslint/parser',
  env: {
    browser: true,
    commonjs: true,
    es6: true,
    node: true
  },
  extends: [
    'plugin:@typescript-eslint/recommended'
  ],
  parserOptions: {
    ecmaVersion: 2020,
    sourceType: 'module'
  },
  rules: {
    'indent': ['error', 2],
    'max-len': ['error', 180],
    'no-trailing-spaces': 1,
    'prefer-const': 0,
    '@typescript-eslint/ban-ts-comment': 0,
    'max-len': 0
  }
};

module.exports = function(grunt) {
  grunt.loadNpmTasks('grunt-sass');
  grunt.loadNpmTasks('grunt-contrib-cssmin');
  grunt.loadNpmTasks('grunt-contrib-copy');
  // grunt.loadNpmTasks('grunt-contrib-uglify');
  grunt.loadNpmTasks('grunt-eslint');
  grunt.loadNpmTasks('grunt-contrib-watch');
  grunt.loadNpmTasks('grunt-protractor-runner');
  grunt.loadNpmTasks('grunt-contrib-connect');
  grunt.loadNpmTasks('grunt-protractor-webdriver');

  const sass = require('sass');

  grunt.initConfig({
    sass: {
      options: {
        // precision: 3, // doesn't work
        implementation: sass,
			  sourceMap: false
      },
      dist: {
        files: {
          'dist/gridstack.css': 'src/gridstack.scss',
          'dist/gridstack-extra.css': 'src/gridstack-extra.scss'
        }
      }
    },
    cssmin: {
      dist: {
        options: {
          sourceMap: false,
          keepSpecialComments: '*'
        },
        files: {
          'dist/gridstack.min.css': ['dist/gridstack.css'],
          'dist/gridstack-extra.min.css': ['dist/gridstack-extra.css']
        }
      }
    },
    copy: {
      dist: {
        files: {
          'dist/es5/gridstack-poly.js': ['src/gridstack-poly.js'],
          'dist/src/gridstack.scss': ['src/gridstack.scss'],
          'dist/src/gridstack-extra.scss': ['src/gridstack-extra.scss'],
          'dist/angular/README.md': ['angular/README.md'],
          'dist/angular/src/gridstack.component.ts': ['angular/projects/lib/src/lib/gridstack.component.ts'],
          'dist/angular/src/gridstack-item.component.ts': ['angular/projects/lib/src/lib/gridstack-item.component.ts'],
          'dist/angular/src/base-widget.ts': ['angular/projects/lib/src/lib/base-widget.ts'],
          'dist/angular/src/gridstack.module.ts': ['angular/projects/lib/src/lib/gridstack.module.ts'],
        }
      }
    },
    // uglify: {
    //   options: {
    //     sourceMap: true,
    //     output: {
    //       comments: 'some'
    //     }
    //   },
    //   dist: {
    //     files: {
    //     }
    //   }
    // },
    eslint: {
      target: ['*.js', 'src/*.js']
    },

    watch: {
      scripts: {
        files: ['src/*.js'],
        tasks: ['copy', 'uglify'],
        options: {
        },
      },
      styles: {
        files: ['src/*.scss'],
        tasks: ['sass', 'cssmin'],
        options: {
        },
      }
    },

    protractor: {
      options: {
        configFile: 'protractor.conf.js',
      },
      all: {}
    },

    connect: {
      all: {
        options: {
          port: 8080,
          hostname: 'localhost',
          base: '.',
        },
      },
    },

    // eslint-disable-next-line @typescript-eslint/camelcase
    protractor_webdriver: {
      all: {
        options: {
          command: 'webdriver-manager start',
        }
      }
    }
  });

  grunt.registerTask('lint', ['eslint']);
  grunt.registerTask('default', ['sass', 'cssmin', /*'eslint',*/ 'copy', /*'uglify'*/]);
  grunt.registerTask('e2e-test', ['connect', 'protractor_webdriver', 'protractor']);
};

// Karma configuration

module.exports = function(config) {
  config.set({

    // see https://www.npmjs.com/package/karma-typescript
    karmaTypescriptConfig: {
      compilerOptions: {
        lib: ['dom', 'es6'],
      },
      // bundlerOptions: {
      //   resolve: {
      //     alias: {
      //     }
      //   }
      // },
      exclude: ["demo", "dist/ng"], // ignore dummy demo .ts files
      include: [
        "./spec/**/*-spec.ts"
      ]
    },

    // base path that will be used to resolve all patterns (eg. files, exclude)
    basePath: '',

    // frameworks to use
    // available frameworks: https://npmjs.org/browse/keyword/karma-adapter
    frameworks: ['jasmine', 'karma-typescript'],

    // list of files / patterns to load in the browser
    files: [
      'src/**/*.ts', // TODO: have to list files else the import in each won't be found!
      'spec/*-spec.ts',
      // 'spec/e2e/*-spec.js' issues with ReferenceError: `browser` & `element` is not defined
    ],
    // BUT list of files to exclude
    // exclude: [
    // ],

    // preprocess matching files before serving them to the browser
    // available preprocessors: https://npmjs.org/browse/keyword/karma-preprocessor
    preprocessors: {
      '**/*.ts': ['karma-typescript']
    },

    // test results reporter to use
    // possible values: 'dots', 'progress'
    // available reporters: https://npmjs.org/browse/keyword/karma-reporter
    reporters: ['progress', 'karma-typescript'],

    coverageReporter: {
      type: 'lcov', // lcov or lcovonly are required for generating lcov.info files
      dir: 'coverage/'
    },

    // web server port
    port: 9876,

    // enable / disable colors in the output (reporters and logs)
    colors: true,

    // level of logging
    // possible values: config.LOG_DISABLE || config.LOG_ERROR || config.LOG_WARN
    // config.LOG_INFO || config.LOG_DEBUG
    logLevel: config.LOG_INFO,

    // enable / disable watching file and executing tests whenever any file changes
    autoWatch: true,

    // start these browsers
    // available browser launchers: https://npmjs.org/browse/keyword/karma-launcher
    browsers: ['ChromeHeadlessCustom'],
    customLaunchers: {
      ChromeHeadlessCustom: {
        base: 'ChromeHeadless',
        flags: ['--window-size=800,600']
      }
    },

    // Continuous Integration mode
    // if true, Karma captures browsers, runs the tests and exits
    singleRun: true,

    // Concurrency level
    // how many browser should be started simultaneous
    concurrency: Infinity,

    random: false,

    client: {
      jasmine: {
        random: false
      }
    }
  });
};

exports.config = {
  seleniumAddress: 'http://localhost:4444/wd/hub',
  specs: ['spec/e2e/*-spec.js'],
  capabilities: {
    browserName: 'firefox',
    version: '',
    platform: 'ANY',
    loggingPrefs: {
      browser: 'SEVERE'
    }
  },
};

{
  "compilerOptions": {
    // "allowJs": true,
    // "esModuleInterop": true,
    // "allowSyntheticDefaultImports": true
    "declaration": true,
    "emitDecoratorMetadata": true,
    "experimentalDecorators": true,
    "inlineSources": true,
    "lib": [ "es6", "es2015", "dom" ],
    "module": "ES2020",
    "noImplicitAny": false,
    "outDir": "./dist",
    "sourceMap": true,
    "strict": false,
    "target": "ES2020"
  }, 
  "include": [
    "./src/**/*.ts"
  ],
  "typeroots": [
    "./node_modules/@types"
  ]
}

const path = require('path');

module.exports = {
  entry: {
    'gridstack-all': './src/gridstack.ts',
  },
  mode: 'production', // production vs development
  devtool: 'source-map',
  // devtool: 'eval-source-map', // for best (large .js) debugging. see https://survivejs.com/webpack/building/source-maps/
  module: {
    rules: [
      {
        test: /\.ts$/,
        use: 'ts-loader',
        exclude: ['/node_modules/'],
      },
    ],
  },
  resolve: {
    extensions: [ '.ts', '.js' ],
  },
  output: {
    filename: '[name].js',
    path: path.resolve(__dirname, 'dist'),
    library: 'GridStack',
    libraryExport: 'GridStack',
    libraryTarget: 'umd', // var|assign|this|window|self|global|commonjs|commonjs2|commonjs-module|amd|amd-require|umd|umd2|jsonp|system
  }
};
